    plate_medium_efficiency_filter_section	INT,
    primary_plate_medium_efficiency_filter_section	INT,
    box_medium_efficiency_filter_section	INT,
    m	INT,
    n	INT,
    o	INT,
    p	INT,
    q	INT,
    r	INT,
    s	INT,
    t	INT,
    u	VARCHAR(512),
    v	INT,
    w	INT,
    x	INT,
    y	INT
